import React, { Component } from "react";
import { PieChart } from 'react-minimal-pie-chart';
    

export default class Usage extends Component {
    render(){
        return(
            <div>
                <div className="row">
                    
                    <div className="col-md-12">
                        <div className="row">
                        Subscription type: <span>&nbsp;&nbsp;&nbsp;Basic</span>
                        </div>
                        &nbsp;
                        <div className="row">
                        Subscription Usage: <span>&nbsp;&nbsp;&nbsp;
                            <span><PieChart
   animation
   animationDuration={500}
   animationEasing="ease-out"
   center={[50, 50]}
   data={[
     {
     color: "#E38627",
     title: "One",
     value: 10,
     },
     {
     color: "#C13C37",
     title: "Two",
     value: 15,
     },
     {
     color: "#6A2135",
     title: "Three",
     value: 20,
     },
   ]}
   labelPosition={50}
   lengthAngle={360}
   lineWidth={15}
   paddingAngle={0}
   radius={50}
   rounded
   startAngle={0}
   viewBoxSize={[100, 100]}
      /></span></span>
                        </div>
                    </div>
                    
                </div>
            </div>
        )  
    }
}
